import{_ as s,c as i,o as n,ag as l}from"./chunks/framework.BDwTZuFy.js";const d=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"138. 会议室预定系统：全部功能测试.md","filePath":"138. 会议室预定系统：全部功能测试.md"}'),p={name:"138. 会议室预定系统：全部功能测试.md"};function c(o,a,g,e,t,h){return n(),i("div",null,a[0]||(a[0]=[l('<p>做完项目之后，我们整体测试一下。</p><p>按照当时的分析出的功能来测：</p><p>首先是普通用户的：</p><h2 id="普通用户" tabindex="-1">普通用户 <a class="header-anchor" href="#普通用户" aria-label="Permalink to &quot;普通用户&quot;">​</a></h2><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-1.png" alt="" loading="lazy"></p><p>进入 backend 和 frontend_user 项目，跑起来。</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>npm run start:dev</span></span></code></pre></div><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-2.png" alt="" loading="lazy"></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>npm run start</span></span></code></pre></div><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-3.png" alt="" loading="lazy"></p><h3 id="注册" tabindex="-1">注册 <a class="header-anchor" href="#注册" aria-label="Permalink to &quot;注册&quot;">​</a></h3><p>首先填入信息，发送验证码：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-4.png" alt="" loading="lazy"></p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-5.png" alt="" loading="lazy"></p><p>用户名要求唯一：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-6.png" alt="" loading="lazy"></p><p>注册成功后我们登录下：</p><h3 id="登录" tabindex="-1">登录 <a class="header-anchor" href="#登录" aria-label="Permalink to &quot;登录&quot;">​</a></h3><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-7.png" alt="" loading="lazy"></p><p>刚才注册的账号可以登录。</p><p>然后还可以 google 账号直接登录，不需要注册：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-8.png" alt="" loading="lazy"></p><h3 id="修改密码" tabindex="-1">修改密码 <a class="header-anchor" href="#修改密码" aria-label="Permalink to &quot;修改密码&quot;">​</a></h3><p>填入用户名、邮箱，点击发送验证码：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-9.png" alt="" loading="lazy"></p><p>（其实当时邮箱应该添加唯一约束，也就是能唯一确定用户，这样就可以不需要填用户名了）</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-10.png" alt="" loading="lazy"></p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-11.png" alt="" loading="lazy"></p><p>修改成功。</p><p>再登录下：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-12.png" alt="" loading="lazy"></p><p>没问题。</p><h3 id="修改个人信息" tabindex="-1">修改个人信息 <a class="header-anchor" href="#修改个人信息" aria-label="Permalink to &quot;修改个人信息&quot;">​</a></h3><p>继续看当时分析的普通用户的需求：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-13.png" alt="" loading="lazy"></p><p>登录后可以修改个人信息。</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-14.png" alt="" loading="lazy"></p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-15.png" alt="" loading="lazy"></p><p>修改下头像：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-16.png" alt="" loading="lazy"></p><p>没问题。</p><h3 id="会议室列表" tabindex="-1">会议室列表 <a class="header-anchor" href="#会议室列表" aria-label="Permalink to &quot;会议室列表&quot;">​</a></h3><p>可以查看会议室列表，根据名称、容纳人数、设备来搜索会议室：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-17.png" alt="" loading="lazy"></p><h3 id="提交预定申请" tabindex="-1">提交预定申请 <a class="header-anchor" href="#提交预定申请" aria-label="Permalink to &quot;提交预定申请&quot;">​</a></h3><p>选择好会议室之后可以提交预定申请：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-18.png" alt="" loading="lazy"></p><p>填入预定时间、备注之后，可以提交预定申请：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-19.png" alt="" loading="lazy"></p><p>然后在预定历史里就可以看到这次预定。</p><p>当然，你可以可以取消预定：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-20.png" alt="" loading="lazy"></p><p>这样该预定记录就会回到已解除状态。</p><h2 id="管理员" tabindex="-1">管理员 <a class="header-anchor" href="#管理员" aria-label="Permalink to &quot;管理员&quot;">​</a></h2><p>接下来我们进入管理员界面：</p><p>登录和修改密码和普通用户差不多。</p><p>我们来测试下各种管理功能：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-21.png" alt="" loading="lazy"></p><h3 id="用户管理" tabindex="-1">用户管理 <a class="header-anchor" href="#用户管理" aria-label="Permalink to &quot;用户管理&quot;">​</a></h3><p>进入 frontend_admin 项目，跑起来：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>npm run start</span></span></code></pre></div><p>然后登录下：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-22.png" alt="" loading="lazy"></p><p>可以按照用户名、昵称、邮箱来搜索用户：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-23.png" alt="" loading="lazy"></p><p>（这个冻结功能目前没啥用，可以去掉）</p><h3 id="会议室管理" tabindex="-1">会议室管理 <a class="header-anchor" href="#会议室管理" aria-label="Permalink to &quot;会议室管理&quot;">​</a></h3><p>可以按照名称、人数、设备来搜索会议室：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-24.png" alt="" loading="lazy"></p><p>可以添加会议室：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-25.png" alt="" loading="lazy"></p><p>之后在用户端这边也可以看到这个会议室了：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-26.png" alt="" loading="lazy"></p><p>当然，也可以更新信息和删除：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-27.png" alt="" loading="lazy"></p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-28.png" alt="" loading="lazy"></p><h3 id="预定管理" tabindex="-1">预定管理 <a class="header-anchor" href="#预定管理" aria-label="Permalink to &quot;预定管理&quot;">​</a></h3><p>预定管理可以按照预定人、会议室名称、预定时间、位置等来搜索预定申请：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-29.png" alt="" loading="lazy"></p><p>比如我们在用户端申请一个：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-30.png" alt="" loading="lazy"></p><p>这时候管理端就可以看到这个申请了：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-31.png" alt="" loading="lazy"></p><p>点击通过，然后在用户端就可以看到审批通过了：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-32.png" alt="" loading="lazy"></p><p>这时候该会议室该时间段就不能再被预定：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-33.png" alt="" loading="lazy"></p><h3 id="统计" tabindex="-1">统计 <a class="header-anchor" href="#统计" aria-label="Permalink to &quot;统计&quot;">​</a></h3><p>这个模块就是可以查看哪些会议室在过去一段时间内被预定的频率高，哪些用户使用会议室的频率高：</p><p><img src="//liushuaiyang.oss-cn-shanghai.aliyuncs.com/nest-docs/image/138-34.png" alt="" loading="lazy"></p><h2 id="总结" tabindex="-1">总结 <a class="header-anchor" href="#总结" aria-label="Permalink to &quot;总结&quot;">​</a></h2><p>我们按照最初的需求分析来过了一遍系统的功能。</p><p>我们首先测了注册、登录、修改密码、google 登录这些通用功能。</p><p>用户端可以搜索会议室、提交预定申请。</p><p>管理端可以审批预定申请，管理会议室、查看统计等。</p><p>整个流程是没问题的。</p><p>项目部署上线之后，就可以投入使用了。</p>',97)]))}const r=s(p,[["render",c]]);export{d as __pageData,r as default};
